import React from "react";
import "./Home.css";


<link href="https://fonts.googleapis.com/css2?family=Dancing+Script:wght@400..700&family=Princess+Sofia&display=swap" rel="stylesheet"></link>

const Home = () => {
  return (
    <div>
      <style>
@import url('https://fonts.googleapis.com/css2?family=Dancing+Script:wght@400..700&family=Princess+Sofia&display=swap');
</style>
    <div className="home">
      <div className="text">
      <h1>Nrithya Parichay</h1> 
      <p>"Unleashing the Beauty of Movement"</p>
      </div>
    </div>
    </div>
  );
};

export default Home;
